column8:
エンブレムリアカメラキットは、トヨタ/ダイハツ/スズキ/スバル車の純正のリアエンブレム取り付け位置に装着できる、カメラカバーに超小型リアカメラを組み込んだユニークなアイテム。<br>エンブレム位置に取り付けられるため、カメラを車体のセンターに装着可能で高い視点からの映像確認ができます。<br>カメラの角度は任意に設定(手動で設定)できるので、通常のバックサポートカメラとしてだけでなく、バックミラーのように後方を確認するカメラとしても利用できます。<br>カメラカバーは耐久性に優れたウレタン製。<br><br><img src="http://image.rakuten.co.jp/ainekusu/cabinet/02339514/imgrc0068593808.jpg"><br><br><img src="http://image.rakuten.co.jp/ainekusu/cabinet/02339514/imgrc0068593819.jpg"><br><br><img src="http://image.rakuten.co.jp/ainekusu/cabinet/02339514/imgrc0068593695.jpg"><br><img src="http://image.rakuten.co.jp/ainekusu/cabinet/02339514/imgrc0068593802.jpg"><br><br><br>※2016年8月8日現在の情報です。最新情報はメーカーページをご確認ください。<style type="text/css">
